// import React from "react";

import { Component } from "react";
export default class Signup extends Component {
    
    constructor(props) {
        super(props)

        this.state = {
              uname: '',
              email: '',
              phone: ''
        }
    }
    //Name_input_textbox
    unameHandling=(e) => {
        this.setState({uname:e.target.value})
    }

    submitHandler=(e)=>
    {
        alert(this.state.uname)
    }

    render() {
        var {uname, email, phone} = this.state
        return (<>
           <div className="container p-3">

             <h4 className="py-3 text-center">USER REGISTRATION</h4>

             <div className="container w-75">

             <form onSubmit={this.submitHandler.bind(this)}>
             <div class="mb-3">
             <label class="form-label">Name</label>
             <input type="text" class="form-control" value={uname} onChange={this.unameHandling.bind(this)} />
             <p>{uname}</p>
            </div>

             <div class="mb-3">
             <label class="form-label">Email</label>
             <input type="email" class="form-control" value={email} onChange={this.unameHandling.bind(this)} />
            </div>

            <div class="mb-3">
             <label class="form-label">Phone</label>
             <input type="number" class="form-control" value={uname} onChange={this.unameHandling.bind(this)} />
            </div> 

            <div class="mb-3">
             
             <button type="submit" class="btn btn-primary">CREATE ACCOUNT</button>
            </div>
            
             </form>

             </div>
           </div>
        
        </>)
    }
}
